import React, { Component } from "react";
import Session from "./pages/session";
import Search from "./pages/search";
import Library from "./pages/library";
import Welcome from "./pages/welcome";
import SignUp from "./pages/signUp";

import NotFoundPage from "./pages/404";

//Import all needed Component for this tutorial
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Link,
  Redirect,
} from "react-router-dom";

// Side Nav imports
import SideNav, { NavItem, NavIcon, NavText } from "@trendmicro/react-sidenav";

// Be sure to include styles at some point, probably during your bootstraping
import "@trendmicro/react-sidenav/dist/react-sidenav.css";

import "font-awesome/css/font-awesome.min.css";

class SessionWeb extends Component {
  state = {};
  render() {
    return (
      <div>
        SessionWeb
        <Router>
          <Route
            render={({ location, history }) => (
              <React.Fragment>
                <SideNav
                  className="sidenav"
                  onSelect={(selected) => {
                    const to = "/" + selected;
                    if (location.pathname !== to) {
                      history.push(to);
                    }
                  }}>
                  <SideNav.Toggle />
                  <SideNav.Nav defaultSelected="Session">
                    <NavItem eventKey="Session">
                      <NavIcon>
                        <i
                          className="fa fa-fw fa-bar-chart"
                          style={{ fontSize: "1.75em" }}
                        />
                      </NavIcon>
                      <NavText>Dashboard</NavText>
                    </NavItem>
                    <NavItem eventKey="Search">
                      <NavIcon>
                        <i
                          className="fa fa-fw fa-users"
                          style={{ fontSize: "1.75em" }}
                        />
                      </NavIcon>
                      <NavText>Customers</NavText>
                    </NavItem>
                    <NavItem eventKey="Library">
                      <NavIcon>
                        <i
                          className="fa fa-fw fa-sliders"
                          style={{ fontSize: "1.75em" }}
                        />
                      </NavIcon>
                      <NavText>Settings</NavText>
                    </NavItem>
                  </SideNav.Nav>
                </SideNav>
                <main>
                  <Switch>
                    <Route exact path="/Session" component={Session} />
                    <Route exact path="/Search" component={Search} />
                    <Route exact path="/Library" component={Library} />
                    <Route exact path="/Welcome" component={Welcome} />
                    <Route exact path="/signUp" component={SignUp} />
                    <Route exact path="/404" component={NotFoundPage} />
                    <Redirect to="/404" />
                  </Switch>
                </main>
              </React.Fragment>
            )}
          />
        </Router>
      </div>
    );
  }
}

export default SessionWeb;
